import './App.css';

const Task = (value) => {
  return (
    <li>{value}</li>
  );
}
const tasks = ['aula de box','estudar inglês','estudar lógica','estudar course','estudar livro Loiane']

function App() {
  return (
    <ol> {Task(tasks)} </ol>
  );
}

export default App;
